import React from "react";
import { Button } from "react-bootstrap";

const LoginSecurity = ({ email, phone }) => {
  return (
    <div>
      <h2>Login & Security</h2>
      <hr />
      <p>Email: {email}</p>
      <p>Phone: {phone}</p>
      <Button>Update</Button>
    </div>
  );
};

export default LoginSecurity;
